import './App.css';
import DiaryEditor from './DiaryEditor';
import DiaryList from './DiaryList';

const dummyList = [
  {
    id: 1,
    author: 'dev.kim',
    content: 'hello~',
    emotion: 5,
    create_date: new Date().getTime(),
  },
  {
    id: 2,
    author: '홍길동',
    content: 'hello~',
    emotion: 5,
    create_date: new Date().getTime(),
  },
  {
    id: 3,
    author: '둘리',
    content: 'hello~',
    emotion: 5,
    create_date: new Date().getTime(),
  },
  {
    id: 4,
    author: '마이콜',
    content: 'hello~',
    emotion: 5,
    create_date: new Date().getTime(),
  },
  {
    id: 5,
    author: '또치',
    content: 'hello~',
    emotion: 5,
    create_date: new Date().getTime(),
  },
];

const App = () => {
  return (
    <div className="App">
      <DiaryEditor />
      <DiaryList dummyList={dummyList} />
    </div>
  );
};
export default App;
